import React from 'react';
import GalleryItem from './GalleryItem';
import './styles/ImageGallery.css';
import ImageOne from "./styles/Images/Customize.jpg"
import ImageTwo from "./styles/Images/DesignImage.jpg"
import ImageThree from "./styles/Images/netArt.jpg"

function ImageGallery() {
    return (
        <section className="imageGallery">
          <figure className="galleryItem">
            <img src={ImageOne} alt="Image 1" className="galleryImage" />
            <figcaption className="galleryCaption">Caption for Image 1</figcaption>
          </figure>

          <figure className="galleryItem">
            <img src={ImageTwo} alt="Image 2" className="galleryImage" />
            <figcaption className="galleryCaption">Caption for Image 2</figcaption>
          </figure>

          <figure className="galleryItem">
            <img src={ImageThree} alt="Image 2" className="galleryImage" />
            <figcaption className="galleryCaption">Caption for Image 2</figcaption>
          </figure>
          {/* Add more images as needed */}
        </section>
      );
    }
  

export default ImageGallery;
